import React, { useEffect, useState } from "react"
import {
  Row,
  Col,
  PageHeader,
  Card,
  Button,
  Input,
  Space,
  Select,
  Empty,
  Form,
  Dropdown,
  Menu,
} from "antd"
import { useHistory, useLocation } from "react-router-dom"
import { FileTextOutlined } from "@ant-design/icons"
import { Editor } from "@tinymce/tinymce-react"
import { ImagePicker } from "../../components"

const { TextArea } = Input

const { Option } = Select

const Laudo = () => {
  const navigation = useHistory()
  const location = useLocation()
  const [component, setComponent] = useState([])
  const [laudoImages, setLaudoImages] = useState([])
  const [selectedImages, setSelectedImages] = useState([])
  const [selectedItems, setSelectedItems] = useState([])
  const [text, setText] = useState("testesss")

  const children = []

  useEffect(() => {
    setLaudoImages(location.state.images)
  }, [location])

  function handleSelectedImages(imgs) {
    setSelectedImages(imgs)
  }

  function handleEditorChange(e) {
    console.log("Content was updated:", e.target.getContent())
  }

  const menu = (
    <Menu>
      <Menu.Item
        onClick={() => setText("1. Teste\n 2. Teste \n 3. Teste")}
        key="2"
      >
        Endoscopia
      </Menu.Item>
    </Menu>
  )

  const OPTIONS = ["Apples", "Nails", "Bananas", "Helicopters"]

  function handleChange(items) {
    console.log("selected")
  }

  const filteredOptions = OPTIONS.filter((o) => !selectedItems.includes(o))
  // eslint-disable-next-line no-plusplus
  for (let i = 10; i < 36; i++) {
    children.push(
      <Option key={i.toString(36) + i}>{i.toString(36) + i}</Option>
    )
  }

  return (
    <Row>
      <Col span={24}>
        <PageHeader onBack={() => window.history.back()} title="Emitir Laudo" />
      </Col>

      <Col span={24}>
        <h1>Dados do Paciente</h1>
      </Col>

      <Row gutter={[24]}>
        <Col span={16}>
          <Card title="Tópicos">
            <Col span={24}>
              <Space>
                <Select
                  mode="multiple"
                  allowClear
                  style={{ width: "100%" }}
                  placeholder="Please select"
                  defaultValue={["a10", "c12"]}
                  onChange={handleChange}
                >
                  {children}
                </Select>
              </Space>
            </Col>
            <Editor
              onDblclick={() => console.log("change")}
              initialValue="<p>Initial content</p>"
              init={{
                height: 500,
                resize: false,
                menubar: false,
                plugins: [
                  "advlist autolink lists link image",
                  "charmap print preview anchor help",
                  "searchreplace visualblocks code",
                  "insertdatetime media table paste wordcount",
                ],
                toolbar:
                  "undo redo | formatselect | bold italic | alignleft aligncenter alignright | bullist numlist outdent indent | help | searchreplace",
              }}
              onChange={handleEditorChange}
            />
          </Card>
        </Col>

        <Col span={8}>
          <Card
            title="Imagens"
            bodyStyle={{ overflowY: "scroll", maxHeight: "500px" }}
          >
            {laudoImages.length >= 1 ? (
              <ImagePicker
                inline
                images={laudoImages.map((image, i) => ({
                  src: image.src,
                  value: i,
                }))}
                multiple
                onPick={(selImgs) => handleSelectedImages(selImgs)}
              />
            ) : (
              <Empty />
            )}
          </Card>
        </Col>
      </Row>
    </Row>
  )
}

export default Laudo
